  `ID` int NOT NULL AUTO_INCREMENT COMMENT '廟宇ID',
  `NAME` varchar(255) NOT NULL COMMENT '廟宇名稱',
  `INFO` varchar(999) NOT NULL COMMENT '廟宇介紹',
  `IMG` varchar(255) NOT NULL COMMENT '照片',
  `GOOGLE_MAP` varchar(999) NOT NULL COMMENT 'GOOGLE地圖',
  `ADDRESS` varchar(255) NOT NULL COMMENT '地址',
  `LOCATION_MAP` varchar(255) NOT NULL,
  PRIMARY KEY (`ID`),
  UNIQUE KEY `NAME_UNIQUE` (`NAME`)
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 COMMENT='廟宇';
