/*!40000 ALTER TABLE `temple` DISABLE KEYS */;
INSERT INTO `temple` VALUES (1,'台南大天后宮',' <p class=\"empleContent\">\n	 大天后宮，舊稱東寧天妃宮，是臺灣第一座官建媽祖廟，爲主祀媽祖的廟宇，此外也是中華民國國定古蹟。\n	 該廟宇原址本為明朝寧靖王朱術桂所居住的寧靖王府邸，後來在寧靖王捨宅之後轉變成媽祖廟，舊有方志多記載是1684年由施琅入臺後改為媽祖廟。\n	 此外大天后宮原為寧靖王府邸，在政治上亦有重要象徵地位，故施琅當時在此接受鄭克塽的投降並立下「平臺紀略碑」，\n	 臺灣民主國第二任總統劉永福將此作為「總統府」。\n </p>\n<p class=\"empleContent\">\n	大天后宮供奉的主神為媽祖，這裡的月老特色是為本來就互相有意的雙方牽線，為愛情加溫，能終成眷屬。\n	所以不管是還在曖昧期的男女，或是已經交往中求穩定扶持的情侶，都很適合來大天后宮拜月老！\n</p>','./images/moonMap/temple_01.jpg,./images/moonMap/temple_02.jpg,./images/moonMap/temple_03.jpg','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3672.738235291101!2d120.19937181529863!3d22.996651323066367!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x346e76616690ed8d%3A0x3685bac9325ba347!2z5aSn5aSp5ZCO5a6u!5e0!3m2!1szh-TW!2stw!4v1607793630433!5m2!1szh-TW!2stw',' 	<p class=\"empleContent\">地址： 700台南市中西區永福路二段227巷18號</p>\n	<p class=\"empleContent\">開放時間： 周一至周日 06:00~20:45</p>\n	<p class=\"empleContent\">開車前往：國道1號-永康交流道下-中正北路-中正南路-公園路-民族路二段-永福路二段-永福路二段227巷</p>','./images/moonMap/台南大天后宮.jpg'),(2,'北港朝天宮','<p class=\"empleContent\">\n	     俗稱北港媽祖廟，是一座位在臺灣雲林縣北港鎮的媽祖廟。相傳1694年，樹璧和尚（臨濟正宗第34代）自福建省湄洲朝天閣迎請媽祖金身前往臺灣，\n	     並自笨港登陸；因媽祖指示，且當地居民強烈要求，於是就地建廟、收徒與傳法。\n	     朝天宮的月老和註生娘娘有許多藝人專程前來求姻緣、求子，不難想像其靈驗之說。若拜月老時一定要先到各殿參拜，並向正殿媽祖及觀音殿說明來意！\n   </p>                             \n  <p class=\"empleContent\">\n       北港媽祖遶境活動，一年總共進行兩次，一次於農曆正月15日進行，另一次則為農曆3月19日、20日的遶境活動，\n	   以後者規模較為盛大，每年農曆3月19、20這兩天，北港家家戶戶都會辦桌請遠方來的親友共同享用美食。\n       在廟口的遶境隊伍出發後，北港街頭鞭炮聲四起，信徒即知道媽祖遶境的祭禮行列出巡了，沿路每戶都會準備香案，水果和金爐恭迎聖駕，這在別處是很少見的。\n   </p>','./images/moonMap/temple2_01.jpg,./images/moonMap/temple2_02.jpg,./images/moonMap/temple2_03.jpg','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d914.253764514868!2d120.30448690439214!3d23.567902663754595!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x0%3A0xe754e91ab3d805d!2z5YyX5riv5aSp5ZCO5a6uIO-8iOacneWkqeWuru-8iQ!5e0!3m2!1szh-TW!2stw!4v1607794728449!5m2!1szh-TW!2stw','<p class=\"empleContent\">地址： 651雲林縣北港鎮中山路178號</p>\n  <p class=\"empleContent\">開放時間： 周一至周日 04:30~24:00</p>	\n  <p class=\"empleContent\">開車前往： 自大林交流道下→循著162、157縣道至新港→右轉164縣道過北港大橋接義民路→再右轉民主路即抵</p>','./images/moonMap/雲林北港朝天宮.jpg'),(3,'慈德慈惠堂','<p class=\"empleContent\">\n	     慈德慈惠堂創建於民國七十二年，供奉瑤池金母、關聖帝君、濟公活佛、文昌帝君、月下老人、註生娘娘等眾神，\n		 其中尤以月下老人的靈顯著稱，更曾在年度全台靈驗月老廟票選中獲得第五名的殊榮。慈惠堂的月下老人除了牽紅線牽得很勤快之外，\n         還擁有一位獨一無二的部屬「氤氳使者」，專打小三、斬斷爛桃花。\n   </p>                             \n  <p class=\"empleContent\">\n        慈德慈惠堂的設有月老郵便局(郵箱)，廟方表示這郵便局是由月老親自指示設置，信眾只需到月老殿拿取專用郵箋（疏文格式，填上自己的資料後投入郵筒內，\n		廟方每隔一個禮拜就會將郵筒內的「信件」取出焚化。這也許是忙碌的月老想出的辦法，希望可以為每位前來祈求的信徒找到良緣，為了不會因為太忙遺漏了誰，於是用信件的方法做紀錄。\n   </p>','./images/moonMap/temple3_01.jpg,./images/moonMap/temple3_02.jpg,./images/moonMap/temple3_03.jpg','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3640.3995523882895!2d120.6511123507595!3d24.15771637893372!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x34693d857a18b3c7%3A0x8684dff0c66d7ec4!2z5oWI5b635oWI5oOg5aCC!5e0!3m2!1szh-TW!2stw!4v1607795852270!5m2!1szh-TW!2stw','<p class=\"empleContent\">地址：407台中市西屯區大墩十九街82號</p>\n  <p class=\"empleContent\">開放時間： 周一至周日 08:00~21:00</p>	\n  <p class=\"empleContent\">開車前往： 中山高速公路台中交流道下-行駛台灣大道往市中心方向-至東興路右轉後-右轉大墩十九街-約5~10分鐘車程。</p>','./images/moonMap/台中慈德慈惠堂.jpg'),(4,'台中樂成宮','<p class=\"empleContent\">\n	     臺中樂成宮，是位於臺灣臺中市東區旱溪里的媽祖廟，此廟主祀之媽祖被稱為旱溪媽祖，建築與遶境活動分別被列為臺中市文化資產的古蹟、無形文化資產。\n		 相傳此廟媽祖為林大發之先祖來旱溪拓墾時所迎請，後由庄民建廟奉祀，興建於乾隆十八年（1753年）。此廟位於漢人從台中市區往大坑山區及太平開墾的必經之地，\n		 也是漢人與原住民接觸做生意之處，因此形成一小市集。道光十二年（1832年）的《彰化縣誌》記載彰化縣內媽祖廟計有二十一座，其中一座位於旱溪庄。\n   </p>                             \n  <p class=\"empleContent\">\n        1904年，霧峰人林垂拱贈送由清朝末代狀元劉春霖所寫「法雨宏施」的匾額[。1921年，旱溪庄保正林源泉、張昧、賴為堯，\n		協同地方人士林大發、龔顯柴、林阿堂、林同、林均等人推動重建工程，1924年廟宇正殿建造完成，1929年三川殿竣工。當時在陳應彬監造下，\n		完成三川殿的重檐假四垂及五門斷檐升箭口。為兩殿式建築，前殿屋頂為重簷歇山頂。\n		戰後地址為東區旱溪街48號，屬旱溪里。省轄市時期，與舊社南興宮、台中萬和宮、台中萬春宮號稱臺中市的四大媽祖廟。\n   </p>','./images/moonMap/temple4_01.jpg,./images/moonMap/temple4_02.jpg,./images/moonMap/temple4_03.jpg','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3640.8841423174727!2d120.69582485075942!3d24.140706579593637!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x34693d465353d8bd%3A0x937d1bfa1e11f41e!2z5Y-w5Lit5qiC5oiQ5a6u!5e0!3m2!1szh-TW!2stw!4v1607797068954!5m2!1szh-TW!2stw','<p class=\"empleContent\">地址：401台中市東區旱溪街48號</p>\n <p class=\"empleContent\">開放時間： 周一至周日 06:30~22:00</p>	\n <p class=\"empleContent\">開車前往： 由中清交流道下高速公路 →循大雅路直行 →遇後莊路左轉 →再行至昌平路轉接北屯路續行→進化路再 左轉直行 →過地下橋左轉即抵達旱溪老街。</p>','./images/moonMap/台中樂成宮.jpg'),(5,'艋舺龍山寺','<p class=\"empleContent\">\n	       艋舺，今名萬華，為臺北市發源地，其最古老市街在紗帽廚社的故址大溪口，即今貴陽街與環河南路口。\n           早年臺灣北部為一蠻煙瘴癘之地，俗諺「三在六亡一回頭」，環境十分險惡，漢人前來墾植時為求神佑，遂於西元1738年合資興建龍山寺，\n           並迎請福建省晉江縣安海龍山寺觀世音菩薩分靈來臺。！\n   </p>                             \n  <p class=\"empleContent\">\n          龍山寺坐北朝南，面呈回字形，為中國古典三進四合院之宮殿式建築，由前殿、正殿、後殿及左右護龍構成。前殿為11開間，分為三川殿、龍門廳、虎門廳。\n          民國七十四年政府公告艋舺龍山寺為國家保護之二級古蹟，與國立故宮博物院、中正紀念堂並列為國際觀光客來臺旅遊的三大名勝。\n   </p>','./images/moonMap/temple5_01.jpg,./images/moonMap/temple5_02.jpg,./images/moonMap/temple5_03.jpg','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3614.9088518069098!2d121.49771201544695!3d25.037167144317525!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3442a9a8d7e7de09%3A0xf8e8335e58c41c8a!2z6b6N5bGx5a-6!5e0!3m2!1szh-TW!2stw!4v1607828002681!5m2!1szh-TW!2stw','<p class=\"empleContent\">地址：10853台北市萬華區廣州街211號</p>\n <p class=\"empleContent\">開放時間： 周一至周日 06:00~22:00</p>	\n <p class=\"empleContent\">開車前往： 國道3號-中和交流道下-市道106甲線-鄉道北91線-市道114線-光復橋-西園路二段至一段-廣州街</p>','./images/moonMap/台北艋舺龍山寺.jpg'),(6,'霞海城隍廟','<p class=\"empleContent\">\n	       台北霞海城隍廟建於清咸豐六年(西元1856年)，落成清咸豐九年(西元1859年)，主祀神祇為霞海城隍爺金身，並奉祀月下老人、七爺八爺、文武判官及千手觀音眾多神祇，\n           是大稻埕地區居民的信仰中心，經評定為國家三級古蹟。相傳香火鼎盛的霞海城隍廟位在「雞母巢穴」上，猶如母雞般持續守護大稻埕的居民，因怕破壞風水地理，\n           加上民眾皆認為廟身小才有利於金雞母，至今並未大動作翻修或擴建\n   </p>                             \n  <p class=\"empleContent\">\n          每年農曆五月十三日為城隍聖誕，城隍廟將於此日舉行遶境活動，各隊陣頭皆賣力演出，是大稻埕地區相當盛大的祭典。\n           除了受人崇敬城隍爺之外，許多單身的民眾也會到此祈求月下老人賜予好姻緣，據廟方表示每年皆會牽線千對以上的佳偶，相當靈驗，欲覓良緣的民眾不妨到此參拜祈求。\n   </p>','./images/moonMap/temple6_01.jpg,./images/moonMap/temple6_02.jpg,./images/moonMap/temple6_03.jpg','https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d28915.575990928482!2d121.5226009886807!3d25.052834446685882!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3442a9147253c4e7%3A0x696d3ec54fe173d2!2z5Y-w5YyX6Zye5rW35Z-O6ZqN5buf!5e0!3m2!1szh-TW!2stw!4v1607918913544!5m2!1szh-TW!2stw','\n	<p class=\"empleContent\">地址：103台北市大同區迪化街一段61號</p>\n		 <p class=\"empleContent\">開放時間： 周一至周日 06:16~19:47</p>	\n		 <p class=\"empleContent\">開車前往： 國道3號-中和交流道下-省道臺64線-板橋出口下-市道106甲線-省道臺3線-環河快速道路-民生西路-迪化街一段。\n	</p>','./images/moonMap/台北霞海城隍廟.jpg');
/*!40000 ALTER TABLE `temple` ENABLE KEYS */;
UNLOCK TABLES;

