CREATE TABLE `temple_location` (
  `ID` int NOT NULL AUTO_INCREMENT COMMENT '資訊編號',
  `lTEMPLE_ID` int NOT NULL COMMENT '廟宇編號',
  `TEMPLE_LOCATION_CATEGORY` varchar(255) NOT NULL COMMENT '周邊資訊分類',
  `IMAGE` varchar(255) NOT NULL COMMENT '景點或美食照片',
  `NAME` varchar(255) NOT NULL COMMENT '景點或美食名稱',
  `GUIDE` varchar(255) NOT NULL COMMENT '介紹',
  `OPEN_TIME` varchar(255) NOT NULL COMMENT '營業時間',
  `ADDRESS` varchar(255) NOT NULL COMMENT '地址',
  `LOCATION_STATUS` tinyint(1) DEFAULT NULL COMMENT '狀態',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `NAME_UNIQUE` (`NAME`),
  KEY `FK_TEMPLE_lTEMPLE_ID_idx` (`lTEMPLE_ID`),
  CONSTRAINT `FK_TEMPLE_lTEMPLE_ID` FOREIGN KEY (`lTEMPLE_ID`) REFERENCES `temple` (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='廟宇景點美食資訊';
