INSERT INTO `temple_location` VALUES (1,1,'美食','./images/moonMap/咖啡icon.svg','Share House Cafe','僻靜巷弄裡的老屋咖啡店，是個適合歇腳放鬆的好去處。','營業時間：週二至周日 09:00-18:30','地址：台南市中西區新美街111號',1),(2,1,'美食','./images/moonMap/餐廳icon.svg','福泰飯桌','有著許多人公認台南最好吃的蝦捲，還有晚來就點不到的紅燒肉，尖峰時刻總是座無虛席。','營業時間：周一至周五 07:30-14:30','地址：台南市中西區民族路二段240號',1),(3,1,'美食','./images/moonMap/餐廳icon.svg','松村煙燻滷味','獨特煙燻味，鹹香帶甜味的在地口味，價格實惠，是來台南必買的伴手禮之一 。','營業時間：周一至周日11：30-21：30','地址：台南市中西區民族路二段319號',1),(4,1,'景點','./images/moonMap/景點icon.svg','赤崁文化園區','早期台南舊城發展的中心，區內古蹟眾多，是台灣少數擁有荷蘭、鄭氏建築的文化園區。','營業時間：周一至週日08:30-21:30','地址：台南市中西區民族路二段212號',1),(5,1,'景點','./images/moonMap/景點icon.svg','開基武廟原正殿','為1669年全台灣首座興建的關帝廟，故名為「開基武廟」。又因該廟與祀典武廟同樣祭祀關公但且面積較小，因此一般人都稱此廟為小關帝廟。','營業時間：周一至周日 07:00-21:00','地址：台南市中西區新美街114號',1),(6,1,'景點','./images/moonMap/景點icon.svg','祀典武廟','台最早關帝廟，也是當時官建的祀典廟宇之一，裡面祀奉正氣凜然的關聖帝君，被稱為大關帝廟。','營業時間：周一至周日06:00-21:00','地址：台南市中西區永福路二段229號',1);
